description:
Route 66 Turns 75

Travel Documentary hosted by Michael Wallis, published by PBS in 2000 - English narration
 &lt;a href=&quot;
http://docuwiki.net/images/4/44/Route-66-Turns-75-Cover.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://docuwiki.net/images/4/44/Route-66-Turns-75-Cover.jpg&lt;/a&gt;

Information
------------------------------

To celebrate the highway's 75th birthday, Michael Wallis updates us on the people and places he's come to know along America's Main Street.
Explore The world's most famous highway - Route 66 - with noted author and 'road warrior' Michael Wallis.

